    pages_page_5.slug = u'who-is-involved'
    pages_page_5.html = u'<h1><strong>Who\'s involved?</strong></h1>\r\n<p class="MsoNormal" style="line-height: normal;"><strong><span style="font-family: &quot;Verdana&quot;,&quot;sans-serif&quot;; color: red;">About OCBC Bank</span></strong><strong><span style="font-size: 10pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;">&nbsp;</span></strong></p>\r\n<p>Singapore&rsquo;s longest established local bank, OCBC Bank currently has assets of S$184 billion and a network of more than 470 branches and representative offices in 15 countries and territories including Singapore, Malaysia, Indonesia, China, Hong Kong SAR, Brunei, Japan, Australia, UK and USA. This network includes more than 360 branches and offices in Indonesia operated by OCBC Bank&rsquo;s subsidiary, PT Bank NISP. OCBC Bank and its banking subsidiaries offer a wide range of specialist financial services, from consumer, corporate, investment, private and transaction banking to treasury and stock-broking services to meet the needs of its customers across communities. <br /><br />OCBC Bank&rsquo;s insurance subsidiary, Great Eastern Holdings, is the largest insurance group in Singapore and Malaysia, in terms of assets and market share, and its asset management subsidiary, Lion Global Investors is one of the largest asset management companies in Southeast Asia. Additional information may be found at www.ocbc.com. <br /><br /><br /><strong>SINGAPORE CHILDREN&rsquo;S SOCIETY</strong><br /><br />The Singapore Children\'s Society helps protect and nurture children and youth of all races and religions, especially those who are abused, neglected, and/or from dysfunctional families. Each year, they reach out to about 16,000 children, youth and families in need.<br />&nbsp;<br />The Singapore Children&rsquo;s Society was founded in 1952 by a group of concerned citizens and expatriates to help poor children, generally those that are 16 years old and younger.<br /><br />The services provided are as follows:<br /><br />&nbsp;&nbsp;&nbsp; *&nbsp; Caregiving<br />&nbsp;&nbsp;&nbsp; *&nbsp; Preventive<br />&nbsp;&nbsp;&nbsp; *&nbsp; Developmental<br />&nbsp;&nbsp;&nbsp; *&nbsp; Remedial<br />&nbsp;&nbsp;&nbsp; *&nbsp; Community<br />&nbsp;&nbsp;&nbsp; *&nbsp; Public Education<br /><br /><strong>Mission</strong><br /><br />To bring relief and happiness to children in need.<br /><br /><strong>Vision</strong><br /><br />To be the leading edge organization in promoting the well-being of the child</p>'
