    pages_page_10 = Page()
    pages_page_10.title = u'Volunteer'
    pages_page_10.slug = u'volunteer'
    pages_page_10.html = u"<p>VOLUNTEERS<br /><br />Wanna participate in the OCBC Cycle Singapore 2010 in a fun and unique way?! Then join us as a volunteer and be part of Singapore&rsquo;s mass cycling event! <br /><br />This year, in our inaugural event on 22nd February 2009, over 700 dedicated volunteers gave their time to cheer on our riders, hand out drinks and provide support, all of which helped to make our participants&rsquo; day that bit easier.<br /><br />Check out come of the comments below from grateful participants on &ldquo;What was your favourite aspect of OCBC Cycle Singapore 2009?&rdquo;<br /><br />&nbsp;&nbsp;&nbsp;&nbsp; Volunteers were excellent! <br />Barry McDonnell<br /><br />&nbsp;&nbsp;&nbsp;&nbsp; Able to cycle continuously on closed roads. The cheers and encouragement given by the volunteers along the way. <br />Goh See Chen<br /><br />&nbsp;&nbsp;&nbsp;&nbsp; Wonderful volunteers cheering for the cyclists! They are very enthusiastic and cheerful, even if they have to be under the sun the whole morning. <br />Edwin Ong<br /><br />We need your support and enthusiasm once again, and are looking for volunteers in the following areas:<br /><br />Pre-event (4th to 6th March 2010)<br />&nbsp;&nbsp;&nbsp;&nbsp; Cycle Pack Collection<br />&nbsp;&nbsp;&nbsp;&nbsp; Lifestyle and Cycling Village<br /><br />Event day (7th March 2010)<br />&nbsp;&nbsp;&nbsp;&nbsp; Route Marshals<br />&nbsp;&nbsp;&nbsp;&nbsp; Aid Stations <br />&nbsp;&nbsp;&nbsp;&nbsp; Start Zone<br />&nbsp;&nbsp;&nbsp;&nbsp; Information Booth<br />&nbsp;&nbsp;&nbsp;&nbsp; Courtesy Crew<br />&nbsp;&nbsp;&nbsp;&nbsp; Athlete Welfare Area<br />&nbsp;&nbsp;&nbsp;&nbsp; Goody Bag <br />&nbsp;&nbsp;&nbsp;&nbsp; Baggage <br />&nbsp;&nbsp;&nbsp;&nbsp; Bike Park / Bike Rental Park<br />&nbsp;&nbsp;&nbsp;&nbsp; Technical Officials Runners<br />&nbsp;&nbsp;&nbsp;&nbsp; Timing Spotters<br />&nbsp;&nbsp;&nbsp;&nbsp; Volunteer Welfare <br />&nbsp;&nbsp;&nbsp;&nbsp; Airport Reception<br />&nbsp;&nbsp;&nbsp;&nbsp; Hotel Secretariat<br /><br />So if you think this sounds like something you want to be a part of, then don&rsquo;t miss out! Our volunteer recruitment will start in early November 2009, so stay tuned and check back on this page for further details. For any enquiries relating to volunteer matters, please email us at volunteers@cyclesingapore.com.sg.<br /><br /><br />&ldquo;Volunteers are the only human beings on the face of the earth who reflect this nation's compassion, unselfish, caring, patience, and just plain love for one another.&rdquo; <br />--Erna Bombeck--</p>"
    pages_page_10.parent = None
    pages_page_10.sort = u'Volunteer'
    pages_page_10.show_fb_stream = False
    pages_page_10.save()

